import { useState } from 'react';
import styled from 'styled-components';
import { Table } from 'antd';

const DataTableWrapper = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-flow: row wrap;
`;

const columns = [
  {
    title: 'Name',
    dataIndex: 'name',
  },
  {
    title: 'Age',
    dataIndex: 'age',
  },
  {
    title: 'Address',
    dataIndex: 'address',
  },
];

const data = [];
for (let i = 0; i < 46; i++) {
  data.push({
    key: i,
    name: `Edward King ${i}`,
    age: 32,
    address: `London, Park Lane no. ${i}`,
  });
}

interface Props {}

const DataTable = ({}: Props): JSX.Element => {
  const [selectedRowKeys, setSelectedRowKeys] = useState([]);

  return <DataTableWrapper></DataTableWrapper>;
};

export default DataTable;
